  simpleNote1(text){
    this.textToSpeech.speak({
      text: text,
      locale: 'en-IN',
      rate: 1
    })
      .then(() => {
        this.counter = this.counter + 1;
        console.log(this.counter);
        if(this.counter < this.Text.length){
          console.log('came in');
          this.simpleNote1(this.Text[this.counter]);
        }
       
        console.log('Done');
        // this.usernameNote();
      }


      )
      .catch((reason: any) =>
        console.log(reason)
      );
  }



  takePicture(sourceType) {
    console.log('take Picture');
    this.Text = [];
    const options: CameraOptions = {
      quality: 100,
      sourceType: sourceType,
      destinationType: this.camera.DestinationType.DATA_URL,
      encodingType: this.camera.EncodingType.JPEG,
      mediaType: this.camera.MediaType.PICTURE

    }

    this.camera.getPicture(options).then((imageData) => {
      // imageData is either a base64 encoded string or a file URI
      // If it's base64 (DATA_URL):
      let base64Image = 'data:image/jpeg;base64,' + imageData;
      console.log(base64Image);
      let src = imageData;

      this.ocr.recText(OCRSourceType.BASE64, src)
        .then((res: OCRResult) => {
          console.log(res);
          try {
            if (res.foundText) {
              res.blocks.blocktext.forEach(element => {
                this.Text.push(element);
              });
            }
            else{
              this.Text.push('No Text Found');
            }
          } catch (e) {

          }

        })
        .catch((error: any) => console.log(JSON.stringify(error)));
    
  }, (err) => {
    // Handle error
  });
  }






